import React from 'react';

interface HeaderProps {
  currentPage: 'upload' | 'search' | 'generate';
  onNavigate: (page: 'upload' | 'search' | 'generate') => void;
  documentCount: number;
}

const Header: React.FC<HeaderProps> = ({ currentPage, onNavigate, documentCount }) => {
  return (
    <header style={{
      background: 'linear-gradient(45deg, #ff6b6b, #4ecdc4, #45b7d1, #96ceb4, #ffeaa7)',
      backgroundSize: '400% 400%',
      animation: 'gradientShift 8s ease infinite',
      color: 'white',
      padding: '0',
      boxShadow: '0 8px 32px rgba(255, 107, 107, 0.3)',
      marginBottom: '30px',
      position: 'relative',
      overflow: 'hidden'
    }}>
      {/* ÂãïÁöÑ„Å™ËÉåÊôØ„Éë„Çø„Éº„É≥ */}
      <div style={{
        position: 'absolute',
        top: '0',
        left: '0',
        right: '0',
        bottom: '0',
        background: `
          radial-gradient(circle at 20% 50%, rgba(255,255,255,0.1) 0%, transparent 50%),
          radial-gradient(circle at 80% 20%, rgba(255,255,255,0.1) 0%, transparent 50%),
          radial-gradient(circle at 40% 80%, rgba(255,255,255,0.1) 0%, transparent 50%)
        `,
        animation: 'float 6s ease-in-out infinite'
      }} />

      {/* CSS Keyframes „Çí„Ç§„É≥„É©„Ç§„É≥„ÅßËøΩÂä† */}
      <style>
        {`
          @keyframes gradientShift {
            0% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
            100% { background-position: 0% 50%; }
          }
          @keyframes float {
            0%, 100% { transform: translateY(0px) rotate(0deg); }
            50% { transform: translateY(-10px) rotate(5deg); }
          }
          @keyframes pulse {
            0%, 100% { transform: scale(1); }
            50% { transform: scale(1.05); }
          }
        `}
      </style>

      <div style={{
        maxWidth: '1200px',
        margin: '0 auto',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        padding: '0 20px',
        position: 'relative',
        zIndex: 2
      }}>
        {/* „É≠„Ç¥„Éª„Çø„Ç§„Éà„É´ */}
        <div style={{ padding: '25px 0', animation: 'pulse 4s ease-in-out infinite' }}>
          <h1 style={{
            margin: '0',
            fontSize: '36px',
            fontWeight: '900',
            background: 'linear-gradient(45deg, #ffffff, #ffe066, #ff6b6b)',
            backgroundClip: 'text',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            textShadow: '0 4px 8px rgba(0,0,0,0.2)',
            letterSpacing: '2px'
          }}>
            ‚ö° NexusDoc
          </h1>
          <p style={{
            margin: '10px 0 0 0',
            fontSize: '18px',
            fontWeight: '600',
            letterSpacing: '1px',
            textShadow: '0 2px 4px rgba(0,0,0,0.3)'
          }}>
            üåü AI-Powered Document Intelligence üåü
          </p>
        </div>

        {/* „Éä„Éì„Ç≤„Éº„Ç∑„Éß„É≥ */}
        <nav style={{ display: 'flex', gap: '10px' }}>
          <button
            onClick={() => onNavigate('upload')}
            style={{
              background: currentPage === 'upload' 
                ? 'linear-gradient(135deg, #ff6b6b, #ff8e8e)' 
                : 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))',
              color: 'white',
              border: 'none',
              padding: '14px 24px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: '700',
              borderRadius: '50px',
              transition: 'all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
              backdropFilter: 'blur(15px)',
              boxShadow: currentPage === 'upload' 
                ? '0 8px 25px rgba(255, 107, 107, 0.4), inset 0 1px 0 rgba(255,255,255,0.2)' 
                : '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)',
              textShadow: '0 1px 2px rgba(0,0,0,0.3)',
              position: 'relative',
              overflow: 'hidden'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.background = 'linear-gradient(135deg, #ff8e8e, #ffb3b3)';
                e.currentTarget.style.transform = 'translateY(-3px) scale(1.05)';
                e.currentTarget.style.boxShadow = '0 12px 35px rgba(255, 107, 107, 0.3)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'upload') {
                e.currentTarget.style.background = 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))';
                e.currentTarget.style.transform = 'translateY(0) scale(1)';
                e.currentTarget.style.boxShadow = '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)';
              }
            }}
          >
            üöÄ „Ç¢„ÉÉ„Éó„É≠„Éº„Éâ
          </button>
          <button
            onClick={() => onNavigate('search')}
            style={{
              background: currentPage === 'search' 
                ? 'linear-gradient(135deg, #4ecdc4, #44a08d)' 
                : 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))',
              color: 'white',
              border: 'none',
              padding: '14px 24px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: '700',
              borderRadius: '50px',
              transition: 'all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
              backdropFilter: 'blur(15px)',
              boxShadow: currentPage === 'search' 
                ? '0 8px 25px rgba(78, 205, 196, 0.4), inset 0 1px 0 rgba(255,255,255,0.2)' 
                : '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)',
              textShadow: '0 1px 2px rgba(0,0,0,0.3)'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.background = 'linear-gradient(135deg, #5dddd4, #52c2ba)';
                e.currentTarget.style.transform = 'translateY(-3px) scale(1.05)';
                e.currentTarget.style.boxShadow = '0 12px 35px rgba(78, 205, 196, 0.3)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'search') {
                e.currentTarget.style.background = 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))';
                e.currentTarget.style.transform = 'translateY(0) scale(1)';
                e.currentTarget.style.boxShadow = '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)';
              }
            }}
          >
            üî• Ê§úÁ¥¢
          </button>
          <button
            onClick={() => onNavigate('generate')}
            style={{
              background: currentPage === 'generate' 
                ? 'linear-gradient(135deg, #45b7d1, #96ceb4)' 
                : 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))',
              color: 'white',
              border: 'none',
              padding: '14px 24px',
              cursor: 'pointer',
              fontSize: '16px',
              fontWeight: '700',
              borderRadius: '50px',
              transition: 'all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
              backdropFilter: 'blur(15px)',
              boxShadow: currentPage === 'generate' 
                ? '0 8px 25px rgba(69, 183, 209, 0.4), inset 0 1px 0 rgba(255,255,255,0.2)' 
                : '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)',
              textShadow: '0 1px 2px rgba(0,0,0,0.3)'
            }}
            onMouseEnter={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.background = 'linear-gradient(135deg, #6cc3e0, #a8d5c4)';
                e.currentTarget.style.transform = 'translateY(-3px) scale(1.05)';
                e.currentTarget.style.boxShadow = '0 12px 35px rgba(69, 183, 209, 0.3)';
              }
            }}
            onMouseLeave={(e) => {
              if (currentPage !== 'generate') {
                e.currentTarget.style.background = 'linear-gradient(135deg, rgba(255,255,255,0.2), rgba(255,255,255,0.1))';
                e.currentTarget.style.transform = 'translateY(0) scale(1)';
                e.currentTarget.style.boxShadow = '0 4px 15px rgba(0,0,0,0.1), inset 0 1px 0 rgba(255,255,255,0.2)';
              }
            }}
          >
            ‚ú® Ë≥áÊñôÁîüÊàê
          </button>
        </nav>

        {/* „Éâ„Ç≠„É•„É°„É≥„ÉàÊï∞Ë°®Á§∫ */}
        <div style={{
          background: 'linear-gradient(145deg, rgba(255,255,255,0.25), rgba(255,255,255,0.1))',
          border: '2px solid rgba(255,255,255,0.2)',
          padding: '12px 20px',
          borderRadius: '30px',
          fontSize: '15px',
          fontWeight: '600',
          backdropFilter: 'blur(10px)',
          boxShadow: '0 4px 15px rgba(255,255,255,0.1)',
          display: 'flex',
          alignItems: 'center',
          gap: '8px'
        }}>
          <span style={{ 
            fontSize: '18px',
            filter: 'drop-shadow(0 1px 2px rgba(0,0,0,0.1))'
          }}>üìÑ</span>
          <span>{documentCount}‰ª∂</span>
        </div>
      </div>
    </header>
  );
};

export default Header;
